/** @format */

import React from "react";
import "../components/main.css";
import Maincontent from "../components/Maincontent";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
import Button from "react-bootstrap/Button";
import Container from "react-bootstrap/Container";
import Card from "react-bootstrap/Card";

function Researches(props) {
  return (
    <div>

      <div className="researchmagestyle"></div>
            <Row className="justify-content-center">
        <text className="stylemaincontent" style={{ marginTop: "-175px" }}>
          {" "}
          أبحاث
        </text>
      </Row>
      <Container fluid={true} className="text-center">
        <Row className="justify-content-center ">
          <Col
            xl={3}
            lg={3}
            md={6}
            sm={12}
            xs={12}
            className="text-center  researchcardbottomspace ">
            <Card className="ResearchCard ">
              <Card.Img variant="top" className="ReseacheImage2" />
              <Card.Body>
                <Card.Title className="CardTitle">اسم البحث</Card.Title>
                <Card.Text className="ResearchText">
                  لمحة مختصرة عن البحث , النقاط الرئيسية في البحث ,...
                </Card.Text>
                <a href="/Research" rel="noopener noreferrer">
                  <Button
                    variant="outline-info"
                    className="ReseachbuttonReadMore">
                    اقرأ المزيد عن هذا البحث
                  </Button>{" "}
                </a>
              </Card.Body>
            </Card>
          </Col>

          <Col
            xl={3}
            lg={3}
            md={6}
            sm={12}
            xs={12}
            className="text-center  researchcardbottomspace">
            <Card className="ResearchCard">
              <Card.Img variant="top" className="ReseacheImage3 " />
              <Card.Body>
                <Card.Title className="CardTitle">اسم البحث</Card.Title>
                <Card.Text className="ResearchText">
                  لمحة مختصرة عن البحث , النقاط الرئيسية في البحث ,...
                </Card.Text>
                <a href="/Research" rel="noopener noreferrer">
                  <Button
                    variant="outline-info"
                    className="ReseachbuttonReadMore">
                    اقرأ المزيد عن هذا البحث
                  </Button>{" "}
                </a>
              </Card.Body>
            </Card>
          </Col>

          <Col
            xl={3}
            lg={3}
            md={6}
            sm={12}
            xs={12}
            className="text-center researchcardbottomspace  ">
            <Card className="ResearchCard ">
              <Card.Img variant="top" className="ReseacheImage1 " />
              <Card.Body>
                <Card.Title className="CardTitle">اسم البحث</Card.Title>
                <Card.Text className="ResearchText">
                  لمحة مختصرة عن البحث , النقاط الرئيسية في البحث ,...
                </Card.Text>
                <a href="/Research" rel="noopener noreferrer">
                  <Button
                    variant="outline-info"
                    className="ReseachbuttonReadMore">
                    اقرأ المزيد عن هذا البحث
                  </Button>
                </a>
              </Card.Body>
            </Card>
          </Col>
        </Row>
      </Container>
    </div>
  );
}

export default Researches;
